import styled from "styled-components";

export const HomeContentContainer = styled.div`
  /* background-color: red; */
  width: 100%;
  display: flex;
  flex-direction: column;
  align-items: flex-end;
  margin: 1%;
  padding: 25px;

  h1 {
    font-weight: bold;
  }

  h2 {
    font-weight: lighter;
    align-items: flex-end;
  }
`;
